  [],\n\t\"revision_timestamp\": \"2016-07-27T22:49:47.566042\",\n\t\"name\": \"necedah-national-wildlife-refuge-narrative-report-may-june-july-august-1952\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from May through August of 1952. The report begins by summarizing
  the weather conditions, water conditions, and food and cover during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, and raptors- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include grazing, haying, and timber removal. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, and violations. N-R forms and photographs are attached.\",\n\t\"license_title\":
